import React from "react";
import "./style.css";

function Sorting(props) {
    return(
        <select onChange={(event) => this.submit(event.target.value)}>
            <option value="sortName">Sort By Name</option>
            <option value="sortAge">Sort By Age</option>
           <option value="sortFileNumber">Sort By Employee File Number</option>
           <option value="sortOffice">Sort By Office Number</option>
     </select>
    )
}

  export default Sorting;
